_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"110255","type":"CustomJS"},{"attributes":{},"id":"109913","type":"SaveTool"},{"attributes":{},"id":"109955","type":"UnionRenderers"},{"attributes":{},"id":"110056","type":"UndoTool"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"cyan"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"cyan"},"line_alpha":{"value":0.1},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":518},"y":{"value":1.2646772099999992}},"id":"109942","type":"Scatter"},{"attributes":{"days":["%d %b","%a %d"],"months":["%m/%Y","%b'%y"]},"id":"109888","type":"DatetimeTickFormatter"},{"attributes":{"active_drag":{"id":"110216"},"active_scroll":{"id":"110217"},"tools":[{"id":"110216"},{"id":"110217"},{"id":"110218"},{"id":"110219"},{"id":"110220"},{"id":"110221"},{"id":"110222"},{"id":"110251"},{"id":"110256"}]},"id":"110224","type":"Toolbar"},{"attributes":{},"id":"110059","type":"SaveTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/NePu3M2t7j8e+an/atTuP8hxvMbb/+4/X28c4QbW7j9tUpwdDODsP21SnB0M4Ow/bVKcHQzg7D9tUpwdDODsP21SnB0M4Ow/bVKcHQzg7D9tUpwdDODsP21SnB0M4Ow/bVKcHQzg7D9tUpwdDODsP21SnB0M4Ow/bVKcHQzg7D9tUpwdDODsP21SnB0M4Ow/bVKcHQzg7D9tUpwdDODsP21SnB0M4Ow/bVKcHQzg7D9tUpwdDODsP/dHgqGsfuw/g3nC29It7D99yWs4fGjsP9SrEuRcRew/+nXxNiud7D/PaoGr59XsP6P5rVV35+w/KyhWxRD76z9zp1vv4PvqP3i68sTw++o/jX1tDY6h6j8mwPmJkdnqP3YZohoYiOo/WZG5ZVCM6j9cvPbuDr7qP4j3BLyVBOw/IYdf0wLJ7D+8v735MaDsP6TNtIuNc+w/Kc1zHK0u7D95W3ZgbjvsPxOU1IadEuw/JxQKRBge7D8CP9xS4TjsPxOU1IadEuw/mJOTF73N6z+sE8nUN9nrP8cwD8yaN+w/4NuBEtR07D8ylcHfU7PsP9OxxmfWzOw/gLHwcuue7D/PhoneF5vsP30/HcLBfew/ugZUIZ2P7D/OzR8Gg4rsP2Mi18peH+w/hkiuCcvi6z8op0O6pu/rP2a9ikQU5+s/wUa6DcwU7D9yI414FPHrP16NFDg7XOw/ljdDc1pV6z8Yu163nOTqP344zi+Db+s/Ds53wwAR6z/eYIkkDnLqP5MDbjLy
